function Header() {
  return (
    <div
      className="title-header"
      style={{
        display: 'flex',
        height: '80px',
        paddingLeft: '20px',
        fontFamily: 'Quicksand, sans-serif',
        fontSize: '32pt',
        backgroundColor: '#08D',
        color: 'white',
        flexDirection: 'column',
        justifyContent: 'center',
      }}
    >
      Airbook
    </div>
  )
}

export default Header;
